Facebook on this browser?\u003C\/div>\u003C\/div>\u003C\/div>\u003Cdiv class=\"_9xl4\">\u003Cdiv>\u003Cdiv class=\"_9xo1\">We use cookies and similar technologies to:\u003C\/div>\u003Cdiv class=\"_9xo2\">\u003Ci class=\"img sp_KVKmoCUgh3b sx_7492e1\">\u003C\/i>\u003Cdiv class=\"_9xo4\">Provide and improve content on Facebook Products\u003C\/div>\u003C\/div>\u003Cdiv class=\"_9xo2\">\u003Ci class=\"img sp_KVKmoCUgh3b sx_f1ce44\">\u003C\/i>\u003Cdiv class=\"_9xo4\">Provide a safer experience by using information we receive from cookies on and off Facebook\u003C\/div>\u003C\/div>\u003Cdiv class=\"_9xo2\">\u003Ci class=\"img sp_KVKmoCUgh3b sx_16bae3\">\u003C\/i>\u003Cdiv class=\"_9xo4\">Help personalize content and services, including ads, on Facebook Products for people who have Facebook accounts\u003C\/div>\u003C\/div>\u003C\/div>\u003Cdiv class=\"_9xo0\">\u003C\/div>\u003Cdiv>\u003Cdiv>For advertising and measurement services off of Facebook Products, analytics, and to provide certain features and improve our services for you, we use tools from other companies on Facebook. These companies also use cookies.\u003C\/div>\u003Cdiv class=\"_9xo3\">You can allow the use of all cookies on this browser or you can choose more options. You can learn more about cookies and how we use them, and review or change your choice at any time in our \u003Ca href=\"https:\/\/www.facebook.com\/policies\/cookies\/\" class=\"_9o-v\" id=\"cpn-pv-link\">Cookie Policy\u003C\/a>.\u003C\/div>\u003C\/div>\u003C\/div>\u003Cdiv class=\"_9xo5\">\u003Cbutton value=\"1\" class=\"_42ft _4jy0 _9xo6 _4jy3 _517h _51sy\" data-cookiebanner=\"manage_button\" data-testid=\"cookie-policy-dialog-manage-button\" title=\"More Options\" type=\"submit\" id=\"u_0_4_3S\">More Options\u003C\/button>\u003Cbutton value=\"1\" class=\"_42ft _4jy0 _9xo7 _4jy3 _4jy1 selected _51sy\" data-cookiebanner=\"accept_button\" data-testid=\"cookie-policy-dialog-accept-button\" title=\"Allow All Cookies\" type=\"submit\" id=\"u_0_5_8v\">Allow All Cookies\u003C\/button>\u003C\/div>\u003C\/div>\u003C\/div>"},5],["__markup_9f5fac15_0_0_bh",{"__html":"\u003Cdiv>\u003Cdiv class=\"_4-i2 _pig _9o-c _9pll _50f4\">\u003Cdiv class=\"_9xre\">\u003Cbutton value=\"1\" class=\"_42ft _4jy0 _9xrd _4jy3 _517h _51sy\" type=\"submit\" id=\"u_0_6_bf\">\u003Ci class=\"img sp_KVKmoCUgh3b sx_d7d0d4\">\u003C\/i>\u003C\/button>\u003Cdiv class=\"_6a uiPopover\" id=\"u_0_7_k6\">\u003Ca role=\"button\" class=\"_42ft _4jy0 _55pi _2agf _4o_4 _9o-e _p _4jy3 _517h _51sy\" href=\"#\" style=\"max-width:200px;\" aria-haspopup=\"true\" aria-expanded=\"false\" rel=\"toggle\" id=\"u_0_8_zc\">\u003Cspan class=\"_-xe _3-8_\">\u003Ci class=\"img sp_8MQ_tLRHai7 sx_a04701\">\u003C\/i>\u003C\/span>\u003Cspan class=\"_55pe\">\u003C\/span>\u003C\/a>\u003C\/div>\u003C\/div>\u003Cdiv class=\"_9o-g\">\u003Cdiv class=\"_9xpt\">Allow the use of cookies from Facebook on this browser?\u003C\/div>\u003Cdiv>\u003Cp class=\"_9o-m\">\u003Cdiv>\u003Cdiv>We use cookies to help provide, personalize and improve the experience on our products. We also use them for ads and analytics, and to provide a safer experience. You can learn more about how we use cookies in our \u003Ca href=\"https:\/\/www.facebook.com\/policies\/cookies\/\" class=\"_9o-v\" id=\"cpn-pv-link\">Cookie Policy\u003C\/a>.\u003C\/div>\u003Cdiv class=\"_9xpu\">We\u2019ll remember your cookie choices and apply them when you are using this browser.\u003C\/div>\u003Cdiv class=\"_9xpv\">\u003Cdiv>\u003Cdiv class=\"_9xpw\">Essential Cookies\u003C\/div>\u003Cdiv>These cookies are required to use Facebook Products. They\u2019re necessary for these sites to work as intended.\u003C\/div>\u003C\/div>\u003Cdiv>\u003Clabel class=\"_9nq9 _9si_\">\u003Cinput checked=\"1\" class=\"_9nqa _9sj1\" disabled=\"1\" type=\"checkbox\" \/>\u003Cspan class=\"_9nqb _9sj0\">\u003C\/span>\u003C\/label>\u003C\/div>\u003C\/div>\u003Cdiv class=\"_9xo0\">\u003C\/div>\u003C\/div>\u003C\/p>\u003Cdiv>\u003Cp class=\"_9o-k\">Other ways you can control tracking\u003C\/p>\u003C\/div>\u003Cdiv>\u003Cdiv class=\"_9vtg\" id=\"u_0_9_K\/\">\u003Cbutton class=\"_9ngd _9nge\" title=\"expandable section\">\u003Cdiv class=\"_9ngc\">\u003Cspan class=\"_9ngf\">\u003Cdiv class=\"_9o-l\">Controls in Your Facebook Account\u003C\/div>\u003C\/span>\u003Cspan class=\"_9ngg _9v7v\">\u003Ci class=\"img sp_KVKmoCUgh3b sx_ca50df\">\u003C\/i>\u003C\/span>\u003C\/div>\u003C\/button>\u003Cdiv class=\"_9ngb _9nga\">\u003Cdiv>\u003Cp class=\"_9o-m\">If you have a Facebook account, you can manage how different data is used to personalize ads with these tools.\u003C\/p>\u003Cp class=\"_9si-\">Ad Settings\u003C\/p>\u003Cp class=\"_9o-m\">To show you better ads, we use data that advertisers and other partners provide us about your activity off Facebook Company Products, including websites and apps. You can control whether we use this data to show you ads in your \u003Ca href=\"https:\/\/www.facebook.com\/settings\/ads\/\">ad settings\u003C\/a>.\u003C\/p>\u003Cp class=\"_9o-m\">The Facebook Audience Network is a way for advertisers to show you ads in apps and websites off the \u003Ca href=\"https:\/\/www.facebook.com\/help\/195227921252400\">Facebook Company Products\u003C\/a>. One of the ways Audience Network shows relevant ads is by using your ad preferences to determine which ads you may be interested in seeing. You can control this in your \u003Ca href=\"https:\/\/www.facebook.com\/settings\/ads\/\">ad settings\u003C\/a>.\u003C\/p>\u003Cp class=\"_9si-\">Ad Preferences\u003C\/p>\u003Cp class=\"_9o-m\">You can use your ad preferences to learn why you&#039;re seeing a particular ad and control how we use information that we collect to show you ads.\u003C\/p>\u003Cp class=\"_9si-\">Off-Facebook Activity\u003C\/p>\u003Cp class=\"_9o-m\">You can review your off-Facebook activity, which is a summary of activity that businesses and organizations share with us about your interactions with them, such as visiting their apps or websites. They use our \u003Ca href=\"https:\/\/www.facebook.com\/help\/2230503797265156\">Business Tools\u003C\/a>, such as Facebook Login or Facebook Pixel, to share this information with us. This helps us do things such as give you a more personalized experience on Facebook. Learn more about \u003Ca href=\"https:\/\/www.facebook.com\/help\/2207256696182627\">off-Facebook activity\u003C\/a>, how we use it, and how you can manage it.\u003C\/p>\u003C\/div>\u003C\/div>\u003C\/div>\u003C\/div>\u003Cdiv>\u003Cdiv class=\"_9vtg\" id=\"u_0_a_bJ\">\u003Cbutton class=\"_9ngd _9nge\" title=\"expandable section\">\u003Cdiv class=\"_9ngc\">\u003Cspan class=\"_9ngf\">\u003Cdiv class=\"_9o-l\">More Information About Online Advertising\u003C\/div>\u003C\/span>\u003Cspan class=\"_9ngg _9v7v\">\u003Ci class=\"img sp_KVKmoCUgh3b sx_ca50df\">\u003C\/i>\u003C\/span>\u003C\/div>\u003C\/button>\u003Cdiv class=\"_9ngb _9nga\">\u003Cdiv>\u003Cp class=\"_9o-m\">You can opt out of seeing online interest-based ads from Facebook and other participating companies through the \u003Ca href=\"https:\/\/l.facebook.com\/l.php?u=https\u00253A\u00252F\u00252Foptout.aboutads.info\u00252F&amp;h=AT1NTLnnDGe_O1zNiSXvrjqKobcuuvImKx3qQbyKODYNwqL2g_F02nL6yF92rGPgjfPA8wt8HcN1LTqVXS-3AbAtfXnGZIK7ZTg7a3MCBy4OcLLIbUQ1FS2ChRyFzTfzBbK71SIkOppQKtsh\" target=\"_blank\" rel=\"nofollow\" data-lynx-mode=\"hover\">Digital Advertising Alliance\u003C\/a> in the US, the \u003Ca href=\"https:\/\/l.facebook.com\/l.php?u=https\u00253A\u00252F\u00252Fyouradchoices.ca\u00252F&amp;h=AT3wH5KGn-C5wJMPpOALUIl-mwiOq4zJ7RgYV2NZEE1WGjFIQw5SRm_MlpEVahjrv--MsB0vKXxBKV1Rjgf_7E-bLWPleub6qlBYLHd55Y5o8Twu_0LHDpN1Z_l9QanVeNbDDhzb5WEFmbgs\" target=\"_blank\" rel=\"nofollow\" data-lynx-mode=\"hover\">Digital Advertising Alliance of Canada\u003C\/a> in Canada or the \u003Ca href=\"https:\/\/l.facebook.com\/l.php?u=https\u00253A\u00252F\u00252Fwww.youronlinechoices.com\u00252F&amp;h=AT3v-VMRx1jImVEcKYXTiG-7IGTdYk0G60qzrqIlSnApK95QSHWubhdF1